max_length inteiro
Número máximo de tokens a serem gerados. Uma palavra é geralmente 2-3 tokens
Valor padrão: 500
temperature número
Ajusta a aleatoriedade das saídas, maior que 1 é aleatório e 0 é determinístico, 0,75 é um bom valor inicial.
Valor padrão: 0.75
top_p número
Ao decodificar texto, amostras da porcentagem p superior dos tokens mais prováveis; inferior para ignorar tokens menos prováveis
Valor padrão: 1
repetition_penalty número
Penalidade por palavras repetidas no texto gerado; 1 não é penalidade, valores maiores que 1 desestimulam a repetição, menores que 1 incentivam.
Valor padrão: 1
seed inteiro
Semente para gerador de números aleatórios, para reprodutibilidade
Valor padrão: -1
